import React from 'react'
import Logo from "../img/finallogo.png";
function Footer() {
  return (
    <footer className='footer'>
      <div className='container'>
        <div className='row'>
          <div className='foo'></div>
        </div>
      </div>
    </footer>
  )
}

export default Footer
